import './ContactLocationMap.css'
import { Wrapper, Status } from "@googlemaps/react-wrapper";

const ContactLocationMap = () => {
    return (
        <div className='contactMapContainer' >
            <h2>Ubicación</h2>
            <div className='contactMap'>
                <h2>AQUI VA EL MAPA</h2>
                <div class="mapouter">
                    <div class="gmap_canvas">
                        <iframe width="600" height="500" id="gmap_canvas" src={"https://maps.google.com/maps?q=2880%20Broadway,%20New%20York&t=k&z=11&ie=UTF8&iwloc=&output=embed"} frameborder="0" scrolling="no" marginheight="0" marginwidth="0">

                        </iframe>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default ContactLocationMap;
